import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  flex: 3;
  height: 100%;
  width: 100%;
  background: #f6f7f8;
`;

const ProfileHeader = styled.div`
  display: flex;
  flex-direction: row;
  background: #ededed;
  padding: 10px;
  align-items: center;
`;

const ProfileImage = styled.img`
  width: 32px;
  height: 32px;
  border-radius: 50%;
`;

const ChatBox = styled.div`
  display: flex;
  flex-direction: row;
  background: #f0f0f0;
  padding: 10px;
  align-items: center;
  bottom: 0;
`;

function ConversationComponent() {
  return (
    <Container>
      <ProfileHeader>
        <ProfileImage src="/profile/theindiandev.jpeg" />
        Ayush Kalra
      </ProfileHeader>
      <ChatBox></ChatBox>
    </Container>
  )
}

export default ConversationComponent
